CREATE DEFINER=`root`@`localhost` PROCEDURE `searchEmp` (IN `emp_` TEXT)   BEGIN
select
users.id,
users.username,
user_job_titles.jobName,
year(users.birthYear) as birthYear,
users.birthYear as birthDate,
users.childCount,
users.childBirthdays,
users.location,
users.location2,
users.jobCode,
users.comments,
users.active,
users.email,
supervisor.userName as supervisorName,
supervisor.id as supervisorId,
users.hireDate,
