supervisor2.id as supervisor2Id,
supervisor3.userName as supervisor3Name,
supervisor3.id as supervisor3Id,
locations.locationName,
locations2.locationName as locationName2,
count(register.date) as holydays,
users.terminateDate,
users.labourTime,
users.prevHolydays,
users.otherHolydays,
users.maternityLeave

from users

left join user_job_titles on user_job_titles.jobCode = users.jobCode
left join register on register.uid = users.id and register.type in(2,6) and year(register.date) = year(curdate())
left join users supervisor on supervisor.id = users.supervisorId
left join users supervisor2 on supervisor2.id = users.super2id
left join users supervisor3 on supervisor3.id = users.super3id
left join locations on locations.id = users.location
left join locations locations2 on locations2.id = users.location2

where 
 users.userName like concat('%',emp_,'%')

 

group by users.id
order by users.active desc,users.userName;

END$$

